import React from 'react'
import { Switch, Route } from "react-router-dom";
import Dashbord from '../views/Dashbord/Dashbord';


import Userlist from '../views/userlist/Userlist';
import Adduser from '../views/adduser/Adduser';
import EditUser from '../views/edituser/EditUser';
import Error404 from '../views/errorPage/Error404';
export default function Sidebarcontent() {
    return (



        <div>

            <Switch>

                <Route exact path='/'><Dashbord /></Route>
                <Route exact path="/userslist"> <Userlist /></Route>
                <Route exact path="/adduser"> <Adduser /></Route>
                <Route exact path="/edituser/:id"><EditUser /></Route>
                <Route component={Error404} />
            </Switch>
        </div>

    )
}
